package com.daengdaeng.domain.pet.domain;import lombok.AccessLevel;import lombok.Getter;import lombok.NoArgsConstructor;import javax.persistence.*;@NoArgsConstructor(access = AccessLevel.PROTECTED)@Getter@Entitypublic class Mbti {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	private Byte mbtiId;	@Column(length = 4, nullable = false)	private String mbti;}